import React from 'react';
import styled from 'styled-components';
import { HeadText, NoticeContainer, NoticeText } from './WayToCome';
import { Hr } from './Calender';
import DropDown from '../components/contact/DropDown';

export default function Contact() {
  return (
    <>
      <ContactWrapper>
        <HeadText>마음 전하실 곳</HeadText>
        <Hr />
        <NoticeContainer>
          <NoticeText>
            참석이 어려우신 분들은 <br />
            축하의 마음을 전해주세요.
          </NoticeText>
        </NoticeContainer>
        <DropDown modifier="어머니" name="권남행" account="1234-567-123485" />
      </ContactWrapper>
    </>
  );
}

export const ContactWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100%;
  background-color: #fefbf8;
  padding: 4rem 2rem;
`;
